import React from "react";
import styled from "styled-components";

const IMG = styled.img`
  width: 500px;
`;

const ImgDesc = styled.div`
  width: auto;
  color: #868e96;
`;

const Slide = ({ img, value }) => {
  return (
    <>
      <IMG src={img} />
      {value === "AI" ? <ImgDesc>인공지능</ImgDesc> : null}
    </>
  );
};

export default Slide;
